  function createORD()
  {
  	if (qORDS.files.length > 0)
  	{
  		qORD["locked"] = "Y";
  		uploadORD(qFileOrd);
  	}
  	var d = new Date();
  	var ddj = d.getFullYear() + '/' + twoDigits(d.getMonth() + 1) + '/' + twoDigits(d.getDate());
  	var hdj = twoDigits(d.getHours()) + ':' + twoDigits(d.getMinutes());
  	qORD = { "id" : curPatient, "date" : ddj, "time" : hdj, "meds" : [ ] };
  	qFileOrd = "R_" + curPatient + "_" + d.getTime();
  	uploadORD(qFileOrd);
  	//setTimeout(loadORDS(curPatient), 500);
  }
  
  function uploadORD(aName)
  {
        $.post("uploadJSONsub.py", {sub: "ordonnances", name: aName, json: JSON.stringify(qORD)}, function(result){
            //alert("L'ordonnance a été enregistrée. "+aName);
            loadORDS(curPatient, true);
        });
  }
  
  function modMed(aNum)
  {
	modalMed = aNum;
	modalMedAdd = false;
        //alert(modalRep2);
	document.getElementById("EmedR").value = qORD.meds[aNum]["med"];
	document.getElementById("EdoseR").value = qORD.meds[aNum]["dose"];
	document.getElementById("EqtyR").value = qORD.meds[aNum]["qty"];
	document.getElementById("EfreqR").value = qORD.meds[aNum]["freq"];
	document.getElementById("EnoteR").value = qORD.meds[aNum]["note"];
	$('.modalMed.modal').modal('show');
  }
  
  function loadOrd()
  {
  var xmlhttp2;
  if (window.XMLHttpRequest)
    {// code for IE7+, Firefox, Chrome, Opera, Safari
    xmlhttp2=new XMLHttpRequest();
    }
  else
    {// code for IE6, IE5
    xmlhttp2=new ActiveXObject("Microsoft.XMLHTTP");
    }
  xmlhttp2.onreadystatechange=function()
    {
    if (xmlhttp2.readyState==4 && xmlhttp2.status==200)
      {
      //alert(xmlhttp2.responseText.length);
      qORD = JSON.parse(xmlhttp2.responseText);
      isLockedORD = false;
      if (qORD.date)
      {
  	var d = new Date();
  	var ddj = d.getFullYear() + '/' + twoDigits(d.getMonth() + 1) + '/' + twoDigits(d.getDate());
      	if (qORD.date != ddj) isLockedORD = true;
      }
      document.getElementById("eachOrd").innerHTML = "";
      var ctrp = 0;
      for (tt in qORD.meds)
      		{
    			div = document.createElement("tr");
    			div.setAttribute("id", "ORD"+ctrp);
    			var toDis = (isLockedORD) ? "disabled ":"";
    			div.innerHTML = '<td><h4><input id="xORD'+ctrp+'" type="checkbox" tabindex="'+ctrp+'" class="hidden"></h4></td><td id="rm'+ctrp+'"><h4>'+qORD.meds[tt]["med"]+'</h4></td><td id="rd'+ctrp+'"><h4>'+qORD.meds[tt]["dose"]+'</h4></td><td id="rq'+ctrp+'"><h4>'+qORD.meds[tt]["qty"]+'</h4></td><td id="rf'+ctrp+'"><h4>'+qORD.meds[tt]["freq"]+'</h4></td><td id="rn'+ctrp+'"><h4>'+qORD.meds[tt]["note"]+'</h4></td><td><h4><div class="ui axxium tiny '+toDis+'button" onclick="modMed('+ctrp+');">Modifier</div></h4></td>';
    			document.getElementById("eachOrd").appendChild(div);
    			ctrp = ctrp + 1;
    	  	}
      if (isLockedORD)
      {
      	document.getElementById("delMED").setAttribute("class","ui axxium tiny disabled button");
      	document.getElementById("addMED").setAttribute("class","ui axxium tiny disabled button");
      }
      else
      {
      	document.getElementById("delMED").setAttribute("class","ui axxium tiny button");
      	document.getElementById("addMED").setAttribute("class","ui axxium tiny button");
      }
      displaySign(qORD,"ORD");
      }
  }

  //alert("Get the qORD!");
  xmlhttp2.open("GET","allScriptsv1.py?tx=getJSONsub&sub=ordonnances&code="+qFileOrd+"&rand="+Math.random(),true);
  xmlhttp2.send();

  }


  function loadORDS(aPat, relBan)
  {
  var xmlhttp2;
  if (window.XMLHttpRequest)
    {// code for IE7+, Firefox, Chrome, Opera, Safari
    xmlhttp2=new XMLHttpRequest();
    }
  else
    {// code for IE6, IE5
    xmlhttp2=new ActiveXObject("Microsoft.XMLHTTP");
    }
  xmlhttp2.onreadystatechange=function()
    {
    if (xmlhttp2.readyState==4 && xmlhttp2.status==200)
      {
      //alert(xmlhttp2.responseText.length);
        qORDS = JSON.parse(xmlhttp2.responseText);
      	curOrd = 0;
      	//alert(qORDS.files.length);
      	if (qORDS.files.length > 0)
      	{
      		if (relBan) displaySub("ordonnances");
      		qFileOrd = qORDS.files[curOrd].file;
      		loadOrd();
      	}
      	else
      	{
      		div = document.createElement("tr");
		aLine = '<td colspan="4"><h3>Aucune ordonnance</h3></td>';
      	  	div.innerHTML = aLine;
    	  	document.getElementById("eachOrd").appendChild(div);
      	}
      }
  }

  //alert("Get the Files!");
  xmlhttp2.open("GET","allScriptsv1.py?tx=getALLsub&sub=ordonnances&patID="+aPat+"&rand="+Math.random(),true);
  xmlhttp2.send();

  }

  function backORD()
  {
      if (curOrd < qORDS.files.length - 1)
      {
      	curOrd = curOrd + 1;
      	qFileOrd = qORDS.files[curOrd].file;
  	loadOrd();
      }
      displaySub("ordonnances");
  }

  function forORD()
  {
      if (curOrd > 0)
      {
      	curOrd = curOrd - 1;
      	qFileOrd = qORDS.files[curOrd].file;
  	loadOrd();
      }
      displaySub("ordonnances");
  }